export const fakeApi = {
  login: async ({ email, password }) => {
    if (email === 'test@example.com' && password === '1234') {
      return { token: 'fake-jwt-token', user: { email } };
    } else {
      throw new Error('Неверный логин или пароль');
    }
  },

  getTrainData: async () => {
  return [
    {
      number: '045А',
      from: 'Рузаевка',
      to: 'Москва',
      seats: [
        { number: 1, isUpper: false, isSide: false, booked: false, price: 3551 },
        { number: 2, isUpper: true, isSide: false, booked: true, price: 3551 },
        { number: 3, isUpper: false, isSide: false, booked: false, price: 3551 },
        { number: 4, isUpper: true, isSide: false, booked: false, price: 3551 },
        // ...
        { number: 21, isUpper: false, isSide: true, booked: false, price: 3551 },
        { number: 22, isUpper: true, isSide: true, booked: true, price: 3551 },
        { number: 23, isUpper: false, isSide: true, booked: false, price: 3551 },
        { number: 24, isUpper: true, isSide: true, booked: false, price: 3551 }
      ]
    }
  ];
}


};
